import React, { Component } from 'react'
import './App.css'
import WeatherApp from './component/WeatherApp';
import {BrowserRouter} from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <BrowserRouter>

        <div className="container">
          <WeatherApp />
        </div>

      </BrowserRouter>
    );
  }
}

export default App;
